/* Loading State */
.loading .sidebar {
  position: fixed;
  z-index: 2;
  top: 80px;
  width: 260px;
  height: calc(100vh - 80px);
  background: grey;
  overflow-y: auto;
  border-right: 1px solid #eee;
}

.loading .content {
  margin-right: 260px;
  width: 100%;
  height: calc(100vh - 80px);
}
.loading .bar {
  border-radius: 3px;
}
.loading .bar::before {
  content: " ";
  display: block;
  width: 80px;
  height: 100%;
  -webkit-transform: translateZ(0);
          transform: translateZ(0);
  -webkit-animation: horizontalScan 1.2s 0s ease-in-out infinite;
          animation: horizontalScan 1.2s 0s ease-in-out infinite;
  background: linear-gradient(to right, rgba(255, 255, 255, 0) 0%, rgba(255, 255, 255, 0.35) 50%, rgba(255, 255, 255, 0) 100%);
  filter: progid:DXImageTransform.Microsoft.gradient( startColorstr='#00ffffff', endColorstr='#00ffffff',GradientType=1 );
}

.loading .bar.x1 {
  height: 30px;
}

@keyframes horizontalScan {
  0% {
    left: -100%;
  }
  100% {
    left: 100%;
  }
}
@-webkit-keyframes horizontalScan {
  0% {
    left: -100%;
  }
  100% {
    left: 100%;
  }
}

/* Container */
.wide {
  width: 100%;
  left: 0px;
}

/* sidebar */
#sidebar {
  font-family: "Roboto", "Helvetica Neue", Arial, sans-serif;
}

#sidebar .sidebar-menu {
  position: fixed;
  z-index: 2;
  top: 80px;
  width: 260px;
  height: calc(100vh - 80px);
  background: #fff;
  overflow-y: auto;
  border-right: 1px solid #eee;
}
#sidebar a {
  text-decoration: none;
  transition: all 300ms ease;
}
#sidebar #spec-sidebar {
  padding-bottom: 100px;
}
#sidebar .sidebar-list li.list-title {
  font-weight: bold;
  color: rgb(38, 38, 38);
  font-size: 16px;
}
#sidebar .sidebar-list li.spec.list-title {
  padding-left: 1.8rem;
}
#sidebar .sidebar-list {
  padding: 0;
  margin-top: 2rem;
}
#sidebar .sidebar-list.info {
  padding-left: 1.8rem;
}
#sidebar .filter-container input{
  width: 200px;
  height: 32px;
  font-size: 15px;
  padding-left: 10px;
  margin: 10px 0 16px 1.8rem;
}
.sidebar-list ul {
  list-style-type: none;
  padding: 0;
  margin: 0;
}
.sidebar-list .method{
  border-radius: 3px;
  margin: 0 1rem 0.5rem;
  padding: 1rem .8rem 1rem 1.6rem;
}
.sidebar-list .method:hover {
  background-color: rgba(237, 30, 30, 0.12);
}
.sidebar-list .method a {
  cursor: pointer;
  position: relative;
  padding-left: 40px;
}
.sidebar-list ul li {
  padding: 0.3rem 0.2rem 0.3rem 0;
  font-size: 14px;
  font-weight: 400;
  color: hsl(205, 13%, 40%);
}
.sidebar-list ul li a {
  color: hsl(205, 13%, 40%);
  /* text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden; */
}
.sidebar-list ul li a:hover {
  color: hsl(205, 13%, 20%);
}
.sidebar-list ul li.submenu {
  padding: .3rem .2rem;
  margin: 0;
}
.sidebar-list ul li.submenu.active ul {
  height: auto;
  max-height: 9999px;
  padding-top: .5rem;
}
.sidebar-list ul li .submenu-title {
  position: relative;
  display: block;
  font-weight: 500;
  color: hsl(205, 13%, 30%);
  cursor: pointer;
  padding: 0.3rem 0.3rem 0.3rem 2.3rem;
  border-radius: 3px;
  overflow: hidden;
  text-overflow: ellipsis;
}
.sidebar-list ul li .submenu-title:hover{
  color: hsl(205, 13%, 20%);
  background: hsl(205, 13%, 95%);
}
.sidebar-list ul li .submenu-title:before {
  position: absolute;
  display: block;
  content: "";
  width: 0;
  height: 0;
  top: 8px;
  left: 10px;
  right: auto;
  border-top: 4px solid transparent;
  border-bottom: 4px solid transparent;
  border-left: 4px solid hsl(205, 10%, 70%);
}
.sidebar-list ul li.active .submenu-title:before {
  border-bottom: 4px solid transparent;
  border-left: 4px solid transparent;
  border-right: 4px solid transparent;
  border-top: 4px solid hsl(205, 10%, 70%);
  top: 12px;
  left: 8px;
}
.sidebar-list ul li .submenu-items {
  max-height: 0;
  overflow: hidden;
}
.sidebar-list ul li .submenu-items a {
  display: block;
  line-height: 1.2;
  font-weight: normal;
  /* text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden; */
}
.sidebar-list li.active > a {
  font-weight: 500;
}
.sidebar-list ul li .method-post:before,
.sidebar-list ul li .method-put:before,
.sidebar-list ul li .method-get:before,
.sidebar-list ul li .method-delete:before,
.sidebar-list ul li .method-patch:before,
.sidebar-list ul li .method-head:before,
.sidebar-list ul li .method-options:before {
  color: white;
  font-size: 9px;
  padding: .28rem .1rem;
  position: absolute;
  top: 0px;
  left: -9px;
  border-radius: 3px;
  font-weight: 600;
  width: 38px;
  display: inline-block;
  text-align: center;
  font-family: monospace;
  margin-right: 5px;
}
.sidebar-list ul li .method-post:before {
  content: "POST";
  background: #49cc90;
}
.sidebar-list ul li .method-put:before {
  content: "PUT";
  background: #fca130;
}
.sidebar-list ul li .method-get:before {
  content: "GET";
  background: #61affe;
}
.sidebar-list ul li .method-delete:before {
  content: "DELETE";
  background: #f93e3e;
}
.sidebar-list ul li .method-patch:before {
  content: "PATCH";
  background: #50e3c2;
}
.sidebar-list ul li .method-head:before {
  content: "HEAD";
  background: #9012fe;
}
.sidebar-list ul li .method-options:before {
  content: "OPTIONS";
  background: #0d5aa7;
}

@media all and (max-width: 1200px) {
  #sidebar {
    position: fixed;
    top: 40px;
    right: 0;
